import React from "react";
import Welcome from "./pages/Welcome";
import Products from "./pages/Products"
import {Route , Router} from "react-router-dom"
import MainHeader from "./components/MainHeader";



function App() {
  return (

    <Router>
    <div>
      <MainHeader/>

      <main>
     <Route path="/welcome">
      <Welcome/>
     </Route>
     <Route path="/products">
      <Products/>
     </Route>
     </main>
    </div>
    </Router>
  );
}

export default App;
